ley Sound/Somass River - WCVI Chinook Salmon (South_Fa_0.X) <\/b><br> Chinook salmon from the Barkley Sound/Somass gillnet and seine net fishery. Management is Highly Effective as nearly all harvested fish are of hatchery origin. Effective management through the Area 23 Stewardship Roundtable brings together a diverse group of rights holders and stakeholders to restore and maintain healthy salmon populations. ","<b> Canada (British Columbia): Northeast Pacific Ocean - Area F <\/b><br> Chinook salmon from the Area F troll fishery.Â Management is Highly Effective because proper data collection ensures in-season monitoring occurs to mitigate bycatch of at-risk Chinook and Chum runs and ensure hatchery impact on wild stocks is considered. ","<b> Canada (British Columbia): Robertson Creek - WCVI - Area 23  <\/b><br> Robertson Creek ESSR dip net fishery.Â Excess salmon to spawning requirement (ESSR) fisheries operate only when target stocks are abundant with a high degree of regulation and monitoring.Â In the case of Robertson Creek, these fish are harvested at the hatchery using modified dip nets and only hatchery fish are retained.Â ","<b> Canada (British Columbia): Chehalis River - Fraser Chum Salmon (Late Run) <\/b><br> Chum from the Fraser â€“ Chehalis ESSR dip net fishery. Excess salmon to spawning requirement (ESSR) fisheries operate only when target stocks are abundant with a high degree of regulation and monitoring. This fishery harvests at the hatchery using modified dip nets and only hatchery fish are retained. Rare early Chum salmon runs are a concern for potential bycatch, but this stock is likely not to be impacted and data collection ensures proper mitigation of at-risk bycatch.","<b> Canada (British Columbia): Nitinat Lake - WCVI - Area E (Area 22) <\/b><br> Chum salmon from the Nitinat River gillnet fishery. Fishery is in-river (or terminal) gillnet at the hatchery and therefore has low instances of bycatch. Certainty of catch, consistency in location, and good data collection ensures minimal bycatch and habitat impacts. Concerns over artificial production were considered in the scoring for this fishery.","<b> Canada (British Columbia): Northeast Pacific Ocean - Area F <\/b><br> Coho salmon from the Area F troll fishery. Management is Highly Effective because in-season monitoring occurs to mitigate bycatch of at-risk Chinook and Chum runs where less than 3% of bycatch for this fishery is at-risk Chinook.Â ","<b> Canada (British Columbia): Robertson Creek - WCVI - Area 23  <\/b><br> Coho from the Robertson Creek ESSR dip net fishery. Excess salmon to spawning requirement (ESSR) fisheries operate only when target stocks are abundant with a high degree of regulation and monitoring.  Fish are harvested at the hatchery using modified dip nets and bycatch is a low concern. ","<b> Canada (British Columbia): Northeast Pacific Ocean - Area 3 (Demonstration) <\/b><br> Pink salmon from the Area 3 demonstration seine net fishery. Demonstration (or â€œdemoâ€) fisheries monitor how many salmon successfully migrate upstream to spawn with high levels of data collection. Â While there is some potential for the bycatch of sensitive stocks, timing and management are used to increase the likelihood that they are avoided. ","<b> Canada (British Columbia): Northeast Pacific Ocean - Area F  <\/b><br> Pink salmon from the Area F troll fishery. Fishing restrictions and seasonal closures limit interactions with southern bound stocks of concern. Although target stock status is largely unknown, data collection on Pink salmon throughout Area F mitigate the risk of overfishing. Troll gear has little impact on surrounding habitat.","<b> Canada (British Columbia): Barkely Sound - WCVI Sockeye Salmon - Henderson Lake <\/b><br> Sockeye salmon from the Barkley Sound/Somass Area 23 (Area D) gillnet & seine net fishery. Effective management through the Area 23 Stewardship Roundtable brings together a diverse group of rights holders and stakeholders to restore and maintain healthy salmon populations. Bycatch and potential for post-release mortality remains a concern but ongoing monitoring is supporting mitigation efforts for at-risk populations. Sockeye populations in this area are largely unassessed but recent status updates from the Pacific Salmon Foundation range from good to data-deficient Henderson Lake stocks are data deficient and scored lower for target stock health compared to other locations within this management area. ","<b> Canada (British Columbia): Barkley Sound - WCVI Sockeye Salmon - Great Central Lake <\/b><br> Sockeye salmon from the Barkley Sound/Somass Area 23 (Area D) gillnet & seine net fishery. Effective management through the Area 23 Stewardship Roundtable brings together a diverse group of rights holders and stakeholders to restore and maintain healthy salmon populations and facilitates data collection, risk assessments, and restoration planning. Bycatch and potential for post-release mortality remains a concern but monitoring is supporting mitigation efforts for at-risk populations. Sockeye populations in this area are largely unassessed but recent status updates from the Pacific Salmon Foundation range from good to data-deficient.","<b> Canada (British Columbia): Barkley Sound - WCVI Sockeye Salmon - Sproat Lake <\/b><br> Sockeye salmon from the Barkley Sound/Somass Area 23 (Area D) gillnet & seine net fishery. Effective management through the Area 23 Stewardship Roundtable brings together a diverse group of rights holders and stakeholders to restore and maintain healthy salmon populations and facilitates data collection, risk assessments, and restoration planning. Bycatch and potential for post-release mortality remains a concern but monitoring is supporting mitigation efforts for at-risk populations. Sockeye populations in this area are largely unassessed but recent status updates from the Pacific Salmon Foundation range from good to data-deficient.","<b> Canada (British Columbia): Meziadin River - Nass Sockeye Salmon <\/b><br> Sockeye salmon from the Meziadin River dip net fishery. The Meziadin fishery catches salmonÂ that are part of theÂ Nass Sockeye population where the Pacific Salmon FoundationÂ considers the run in fair condition. This Recommendation covers part of the Gitanyow Huwilp modern fishing enterprise, a First Nations community-led fishery. The Gitanyow Fisheries Authority is involved in the co-management of the fishery along with government departments to ensure fish are counted each year and managed accordingly. The dip nets used in this fishery are highly selective and avoid negative interactions with at-risk species.","<b> Canada (British Columbia): Babine Lake - Fulton & Pinkut Spawning Channel terminal fisheries <\/b><br> Sockeye salmon from theÂ Babine Lake Fulton & Pinkut Spawning Channel terminalÂ fishery using seine nets and traps (fish wheels & fish traps).Â In-river (or terminal) fishery at the hatchery has low instances of bycatch. Harvest withing these fisheries are restricted by time and location. As known stock excess salmon to spawning requirement (ESSR) fisheries operate only when target stocks are abundant with a high degree of regulation and monitoring where all harvest occurs within a 500 meter boundary of Fulton and Pinkut spawning channels. Concerns over artificial production were considered in the scoring for this fishery.","<b> Canada (British Columbia): Babine Lake - Fulton & Pinkut Spawning Channel terminal fisheries <\/b><br> Sockeye salmon from theÂ Babine Lake Fulton & Pinkut Spawning Channel terminalÂ fishery using seine nets and traps (fish wheels & fish traps).Â In-river (or terminal) fishery at the hatchery has low instances of bycatch. Harvest withing these fisheries are restricted by time and location. As known stock excess salmon to spawning requirement (ESSR) fisheries operate only when target stocks are abundant with a high degree of regulation and monitoring where all harvest occurs within a 500 meter boundary of Fulton and Pinkut spawning channels. Concerns over artificial production were considered in the scoring for this fishery."],null,null,{"interactive":false,"permanent":false,"direction":"auto","opacity":1,"offset":[0,0],"textsize":"10px","textOnly":false,"className":"","sticky":true},null]},{"method":"addLegend","args":[{"colors":["turquoise","lightgreen","orange","hotpink","yellow","grey"],"labels":["Chinook","Coho","Sockeye","Pink","Chum","Multiple Species"],"na_color":null,"na_label":"NA","opacity":1,"position":"bottomright","type":"unknown","title":"Salmon Species","extra":null,"layerId":null,"className":"info legend","group":null}]}],"limits":{"lat":[48.6670910364,56.02559744],"lng":[-138.7586511038,-121.968]},"setView":[[54,-126.5],5,[]]},"evals":[],"jsHooks":[]}</script>
